            <div id="errorPage" class="full-height">
                <img src="http://localhost:8080/assets/images/2020-02-12_10-27-20_67b2b8a5159c63d082c5c4145d505749.png" alt="blog-logo"/>
                <h1>404</h1>
                <h2>Sorry! Page not found!</h2>
            </div> 
        </div>
    )
}
